    <link rel="stylesheet" href="./umi.09c0c036.css" />
    <script>
      window.routerBase = location.pathname
        .split("/")
        .slice(0, -1)
        .concat("")
        .join("/");
    </script>
    <script>
      window.publicPath =
        location.protocol +
        "//" +
        location.hostname +
        (location.port ? ":" + location.port : "") +
        window.routerBase;
    </script>
